import {ReactSVG} from 'react-svg';
import Popular from '../components/Popular';

const userProfile = (props) => {
    return (
        <Container>
        <Row>
            <h1>Welcome to your Profile</h1>
        </Row>
        <Row>
            <Col className='border-right' sm='12' md='4'> 
            <Card>
                <CardTitle>Recent History</CardTitle>
                <ListGroup>
            <ListGroupItem tag='a' action>className='fab mr-2'  />All</ListGroupItem>
            <ListGroupItem tag='a' action> className='fab mr-2'  />Xbox One</ListGroupItem>
            <ListGroupItem tag='a' action>  />Playstation 4</ListGroupItem>
            <ListGroupItem className='d-flex align-items-center' tag='a' action>/>Nintendo Switch</ListGroupItem>
          </ListGroup>
            </Card>
            </Col>
        </Row>
    </Container>
    )

}

export default userProfile;
